import React from 'react';
import './sellershop.css';

export const SellerShop = () => {
    return (
        <div className="seller-shop-container">
            <div className="seller-header">
                <div className='logo'>
                    <img
                        src="https://i.pinimg.com/736x/92/15/43/921543c34c68ea87e24e462e7f1718e8.jpg"
                        alt="Seller Avatar"
                        className="seller-avatar"
                    />
                </div>


            </div>
        </div>
    );
};
